import React from "react";

const Button = ({
    label = 'Button',
    type = 'Button',
    className='',
    disabled = 'false,'
}) => {
    return(
    <button type={type} className={'text-white bg-primary hover:bg-primary focus:ring-4 focus:outline-none focus:ring-blue-200 font-medium rounded-lg text-sm w-full  px-5 py-2.5 text-center ${className}'} 
    disabled={disabled}>{label}</button>
    )
}

export default Button
